def createTable(variables,head,val):
    dataframe = pd.DataFrame({'Head_predicate': pd.Series(variables),'Head_objects': pd.Series(head),
                              'Number_Patients': pd.Series(val)})
    return dataframe

def extractHead(my_dict, df):
    head = my_dict['Properties to Explore']
    query = f"""SELECT Head FROM df WHERE Head LIKE '%{head}%' GROUP BY Head"""
    lst = sqldf(query, locals())
    head_obj = (lst['Head'].str.split().str[2]).to_list()
    # print(head_obj)
    return head,head_obj


def main_rulesHead(my_dict, data_dict):
    # my_dict = read_json("input/input-file-Rules.json")
    df = pd.DataFrame.from_dict(data_dict)
    head_pred, head_obj = extractHead(my_dict, df)
    head, val = query_generation(head_obj, "http://kg_lc:8890/sparql")
    res = createTable(head_pred, head, val)
    return res, my_dict
